(function () {
  QUnit.config.testTimeout = 5000;

  var _videoJs
  , videoJsAliases = ['videojs', 'vjs', '_V_']
  , i, ii, alias;
  
  for(i=0, ii=videoJsAliases.length; i<ii; i++) {
    alias = videoJsAliases[i];
    
    if(window[alias] !== undefined) {
      _videoJs = window[alias];
      break;
    }
  };
  
  module("image",{
    setup: function() {
      //Create the image element
      var image = new Image()
      /*
      * We have to wait for
      * 1. The image to load
      */
      , waitForThings = 1
      , checkIfReady = function() {
          waitForThings--;
          
          if(waitForThings<=0) {
            start();
          }
        };
      
      //Stop test runner
      stop();
      
      //Bind to the image loaded event
      image.onload = function(e) {
        e.preventDefault();
        e.stopPropagation();
        
        ok(true, "Image loaded");
      
        //Add the image
        $("#qunit-fixture").append(image);
        
        checkIfReady();
      };
      
      image.setAttribute("id", "demo_image");
      image.src = "media/globe.jpg";
    }
  });
  
  test("test resize", 2, function() {
    var image = $("#demo_image")[0]
      , opts = {
          maxWidth: 640
        , maxHeight: 468
        }
      , base64Data = jsthumb.resize(image, opts);
      
      ok(base64Data,"Screenshot was taken")
  });
  
  asyncTest("test resizeData", 2, function() {
    var imageData = "data:image/jpeg;base64,"
      , opts = {
          maxWidth: 640
        , maxHeight: 468
        };
      
      jsthumb.resizeData(imageData, opts, function(err, base64Data) {
        //TODO: Figure out a way to calculate similarity between images as every captured image is slightly different...
        ok(base64Data,"Thumbnail was taken")
        console.log(imageData);
        console.log(base64Data);
        start();
      });
  });

  module("helpers");
  
  asyncTest("test loadVideo", 6,function() {
    var videoOpts = {
        sources: [
          {
            src: "media/lego.mp4"
          , type: "video/mp4"
          }
        , {
            src: "media/lego.webm"
          , type: "video/webm"
          }
        ]
      , attributes: {
          id: "demo_video_one"
        }
      };
    
    //Add the video
    jsthumb.loadVideo($("#qunit-fixture")[0], videoOpts, function (err, element, player, supported) {
      ok(true, "Video.js loaded");
      
      var video = $("#demo_video_one").find("video")[0]
        , object = $("#demo_video_one").find("object")[0];
      
      ok(element, "Video container exists");
      ok(video || object, "Video element exists");
      ok(player, "Player exists");
      
      if(supported) {
        if(_videoJs.IS_IOS || _videoJs.IS_ANDROID) {
          ok(true, "SKIPPED (Mobile Browser)");
          ok(true, "SKIPPED (Mobile Browser)");
        }
        else {
          ok(player.width(), "Player width is present (Ideally: 560)");
          ok(player.height(), "Player height is present (Ideally: 320)");
        }
      }
      else {
        ok(true, "SKIPPED (Flash Fallback)");
        ok(true, "SKIPPED (Flash Fallback)");
      }
      
      start();
      player.dispose();
    });
  });
  
  module("video");
  
  asyncTest("test screenshot", 2,function() {
    var videoOpts = {
        sources: [
          {
            src: "media/lego.mp4"
          , type: "video/mp4"
          }
        , {
            src: "media/lego.webm"
          , type: "video/webm"
          }
        ]
      , attributes: {
          id: "demo_video_two"
        }
      };
    
    //Add the video
    jsthumb.loadVideo($("#qunit-fixture")[0], videoOpts, function (err, element, player, supported) {
      ok(true, "Video.js loaded");
      
      if(supported) {
        var video = $("#demo_video_two").find("video")[0]
          , player = _videoJs("demo_video_two")
          , opts = {
              origWidth: player.width()
            , origHeight: player.height()
            }
          , base64Data = jsthumb.screenshot(video, opts);
        
        //TODO: Figure out a way to calculate similarity between images as every captured image is slightly different...
        ok(base64Data,"Screenshot was taken")
        start();
        player.dispose();
      }
      else {
        ok(false, "Screenshots not supported");
        start();
        player.dispose();
      }
    });
  });
  
}());